local core=require("wetgenes.aelua.data.core")module("wetgenes.aelua.data")function keyinfo(keystr)	return core.keyinfo(keystr)endfunction keystr(kind,id,parent)	return core.keystr(kind,id,parent)endfunction put(ent)	return core.put(ent)endfunction get(ent)	return core.get(ent)endfunction query(q)	return core.query(q)end